import React from "react";
import './Teammediajr.css';
import { Secretariatmediajr } from './Dataset';

import {HiOutlineMail} from 'react-icons/hi';
import {FaLinkedinIn} from 'react-icons/fa';
import {FaFacebookF} from 'react-icons/fa';
import Underline2 from "./Underline2";
export default function(){
    return(
           <>
           <div className="team-head2">
           <h1 className="team-head-h1">Web Development Team</h1>
           </div>
        <div className="team-stats-card2">
           {Secretariatmediajr.map((item) => {
               return(
                       <div key={item.id} className="team-stats2">
                       <div>
                           <center><img className="team-img5" src={item.imgsrc} alt="" /></center>
                        </div>


                        <div className="social-media">
                        <div className="icon1">
                            <a href={item.mail}><HiOutlineMail className="icon-color" size={20} /></a>
                        </div>
                        <div className="icon2">
                        <a href={item.linkedin} target="_blank"><FaLinkedinIn className="icon-color1" size={20} /></a>
                        </div>
                        <div className="icon3">
                        <a href={item.fb} target="_blank"><FaFacebookF className="icon-color2" size={20} /></a>
                        </div>
                        </div>



                       <h1>{item.name}</h1>
                       <Underline2 />
                       <h2 className="team-posting-sec">{item.post}</h2>
                    </div>
               )
           })}
           </div>
           </>
    )
}
